import React from 'react';

function PairingDashboard({ dashboard }) {
  return (
    <div className="dashboard">
      <h2>Pairing Dashboard</h2>
      <ul>
        {dashboard.map((pair, index) => (
          <li key={index}>
            {pair.student1} & {pair.student2}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PairingDashboard;
